SELECT SUBSTR(DTETIM,1,2) YY, SUBSTR(DTETIM,3,2) MM, SUBSTR(DTETIM,5,2) DD, SUBSTR(DTETIM,7,2) HH --, COUNT(JBTCPU) CPU 
FROM AS400POOLFAULTING2EIBS --WHERE JBTCPU IS NOT NULL 
GROUP BY  SUBSTR(DTETIM,1,2), SUBSTR(DTETIM,3,2), SUBSTR(DTETIM,5,2),SUBSTR(DTETIM,7,2)
ORDER BY YY,MM,DD,HH;

SELECT distinct SUBSTR(DTETIM,1,8) FROM AS400CPUTILIZEIBS 
WHERE SUBSTR(DTETIM,1,2) ='15' AND SUBSTR(DTETIM,3,2) ='12' and SUBSTR(DTETIM,5,2) ='30' and SUBSTR(DTETIM,7,2) in ('8','9','10','11') ORDER BY SUBSTR(DTETIM,1,6);


